pragma solidity ^0.8.9;

contract Combat {
    constructor() {
        monsters[GOBLIN] = monster("GOBLIN", 3, 20);
    }

    uint256 public constant GOBLIN = 0;

    struct monster {
        string name;
        uint256 lvl;
        uint256 xp;
    }

    mapping(uint256 => uint256[]) public drops;
    mapping(uint256 => monster) public monsters;
}

